import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function App() {
  const [city, setCity] = useState("");
  const [cities, setCities] = useState([]);
  return (
    <div className="App">
      <input></input>
      <button onClick={() => setCities([...cities, city])}>Add City</button>
      <ul>
        {cities.map((city) => (
          <li>
            {city}-<button>X</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
